import styled from "styled-components";

const DataContainer = styled.div`
  background-color: #fff;
  max-height: 350px;
  height: 350px;
  margin-bottom: 0;
  position: relative;
  min-width: 1px;
  box-sizing: border-box;
  padding: 20px;
  width: 100%;
  max-width: 100%;
  overflow: hidden;
`;

export default DataContainer;
